from mobile.model.pages import *from api import *import pytest@allure.feature('MOBILE')@allure.story('MOBILE ALL')@allure.suite('Регистрация')@allure.tag('autotests', 'mobile')@allure.title('Регистрация мобильного приложения под абонентом сервера')def test_registration(created_mobile_account):    open_app(visible_name=__name__)    open_settings()    input_registered(address=TestData.ip_server,                     authorization=True,                     login=created_mobile_account,                     password=created_mobile_account)    check_status_registration(created_mobile_account)@allure.feature('MOBILE')@allure.story('MOBILE ALL')@allure.suite('Контакты')@allure.tag('autotests', 'mobile')@allure.title('Добавить контакт в адресную книигу')@pytest.mark.parametrize('name', ['tests name', 'Test', '123Test'])@pytest.mark.parametrize('number', ['32423', 'Test', '123Test'])@pytest.mark.parametrize('mail', ['test@mail.ru', None])def test_add_contact(name, number, mail):    open_app(visible_name=__name__)    add_contact(name=name, number=number, mail=mail)    click_contact(name)